import{_ as s,o as a,c as o,R as e}from"./chunks/framework.333b51ca.js";const h=JSON.parse('{"title":"PostgreSQL div() 函数","description":"","frontmatter":{},"headers":[],"relativePath":"database/postgreSQL/ref/div.md","filePath":"database/postgreSQL/ref/div.md","lastUpdated":1690010418000}'),l={name:"database/postgreSQL/ref/div.md"},n=e('<h1 id="postgresql-div-函数" tabindex="-1">PostgreSQL div() 函数 <a class="header-anchor" href="#postgresql-div-函数" aria-label="Permalink to &quot;PostgreSQL div() 函数&quot;">​</a></h1><p>PostgreSQL <code>div()</code> 函数将指定的两个数字做除法运算并返回整数商。</p><h2 id="div-语法" tabindex="-1"><code>div()</code> 语法 <a class="header-anchor" href="#div-语法" aria-label="Permalink to &quot;`div()` 语法&quot;">​</a></h2><p>这里是 PostgreSQL <code>div()</code> 函数的语法：</p><div class="language-sql"><button title="Copy Code" class="copy"></button><span class="lang">sql</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#A6ACCD;">div(y, x) </span><span style="color:#89DDFF;">-&gt;</span><span style="color:#A6ACCD;"> </span><span style="color:#C792EA;">integer</span></span></code></pre></div><h3 id="参数" tabindex="-1">参数 <a class="header-anchor" href="#参数" aria-label="Permalink to &quot;参数&quot;">​</a></h3><ul><li><p><em><code>y</code></em></p><p>必需的。 被除数。</p></li><li><p><em><code>x</code></em></p><p>必需的。 除数。</p></li></ul><h3 id="返回值" tabindex="-1">返回值 <a class="header-anchor" href="#返回值" aria-label="Permalink to &quot;返回值&quot;">​</a></h3><p>PostgreSQL <code>div()</code> 函数返回 <code>y</code> 除以 <code>x</code> 的整数商，即 <code>y/x</code> 结果的整数部分。</p><p>如果参数为 <code>NULL</code>，<code>div()</code> 函数将返回 <code>NULL</code>。</p><p>如果您提供了一个不是数字类型的参数，PostgreSQL 将给出一个错误。</p><h2 id="div-示例" tabindex="-1"><code>div()</code> 示例 <a class="header-anchor" href="#div-示例" aria-label="Permalink to &quot;`div()` 示例&quot;">​</a></h2><p>这里有几个 <code>div()</code> 函数的示例。</p><div class="language-sql"><button title="Copy Code" class="copy"></button><span class="lang">sql</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#F78C6C;">SELECT</span></span>\n<span class="line"><span style="color:#A6ACCD;">    div(</span><span style="color:#F78C6C;">3</span><span style="color:#A6ACCD;">, </span><span style="color:#F78C6C;">2</span><span style="color:#A6ACCD;">) </span><span style="color:#F78C6C;">AS</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">&quot;</span><span style="color:#C3E88D;">div(3, 2)</span><span style="color:#89DDFF;">&quot;</span><span style="color:#A6ACCD;">,</span></span>\n<span class="line"><span style="color:#A6ACCD;">    div(</span><span style="color:#F78C6C;">3</span><span style="color:#A6ACCD;">.</span><span style="color:#F78C6C;">3</span><span style="color:#A6ACCD;">, </span><span style="color:#F78C6C;">1</span><span style="color:#A6ACCD;">.</span><span style="color:#F78C6C;">2</span><span style="color:#A6ACCD;">) </span><span style="color:#F78C6C;">AS</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">&quot;</span><span style="color:#C3E88D;">div(3.3, 1.2)</span><span style="color:#89DDFF;">&quot;</span><span style="color:#A6ACCD;">;</span></span></code></pre></div><div class="language-bash"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#FFCB6B;">div(3,</span><span style="color:#A6ACCD;"> </span><span style="color:#F78C6C;">2</span><span style="color:#A6ACCD;">) </span><span style="color:#89DDFF;">|</span><span style="color:#A6ACCD;"> </span><span style="color:#FFCB6B;">div(3.3,</span><span style="color:#A6ACCD;"> </span><span style="color:#F78C6C;">1.2</span><span style="color:#A6ACCD;">)</span></span>\n<span class="line"><span style="color:#FFCB6B;">-----------+---------------</span></span>\n<span class="line"><span style="color:#A6ACCD;">         </span><span style="color:#FFCB6B;">1</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">|</span><span style="color:#A6ACCD;">             </span><span style="color:#FFCB6B;">2</span></span></code></pre></div><p>这里，</p><ul><li><code>3 / 2 = 1.5</code>，<code>1.5</code> 的整数部分是 <code>1</code>，因此 <code>div(3, 2)</code> 返回了 <code>1</code>。</li><li><code>3.3 / 1.2 = 2.75</code>，<code>2.75</code> 的整数部分是 <code>2</code>，因此 <code>div(3.3, 1.2)</code> 返回了 <code>2</code>。</li></ul>',17),p=[n];function c(t,d,r,i,C,y){return a(),o("div",null,p)}const D=s(l,[["render",c]]);export{h as __pageData,D as default};
